/**
 * ini文件解析
 */
(function(N){
    
    function parseIniFile(file){
        if(!fs.existsSync(file)){
            return false;
        }
        
        var result = {};
        //读取ini文件
        var contents = fs.readFileSync(file, "UTF-8");
        var lines = contents.split('\n');
        var group = '';
        for(var i = 0; i < lines.length; i++){
            var line = lines[i].trim();
            
            if(line[0] == '['){
                group = line.substring(1, line.length - 1);
                result[group] = {};
            }else if(line.indexOf('=') > 0 && line[0] != '#' && line[0] != ';' && line[0] != '['){
                var key = line.substring(0, line.indexOf('='));
                var val = line.substring(line.indexOf('=') + 1, line.length);
                
                result[group][key] = val;
            }
        }
        
        return result;
    }
    
    function saveIniFile(file, mapIniData){
        var arr = [];
        for(var name in mapIniData){
            arr.push('\r\n[' + name + ']');
            
            
            for(var key in mapIniData[name]){
                arr.push(key + '=' + mapIniData[name][key]);
            }
        }
        
        fs.writeFileSync(file, arr.join('\r\n'), 'utf8');
    }
    
    
    N.parseIniFile = parseIniFile;
    N.saveIniFile = saveIniFile;
})(module.exports);

module.exports.getText = getText;

module.exports.Lang = {
    getText: function(textName){
        
        if(this.DATA[this.langName][textName] == undefined){
            return textName;
        }
        
        return this.DATA[this.langName][textName];
    },
    chooseLang: function(langName){
        this.langName = this.DATA[langName] == undefined ? 'English' : langName;
    },
    getLangs: function(){
        var arr = [];
        
        for(var name in this.DATA){
            arr.push(name);
        }
        
        return arr;
    },
    DATA: {
        'English': require('./lang/English.js'),
        'Chinese': require('./lang/Chinese.js')
    },
    langName: 'Chinese'
};


/**
 * 语言处理
 */
function getText(textName){
    return module.exports.Lang.getText(textName);
}

function executor(callback){
    return new Promise(function(resolve, reject){
        callback(resolve);
    });
}

module.exports.executor = executor;

module.exports.logToConsole = false;
/**
 * 日志记录
 */
function logger() {
    var simpleTypes = ["number", "undefine", "string", "boolean"];
    
	for (var i = 0; i < arguments.length; i++) {
        var content = (now()) + " ";
        
        if(simpleTypes.indexOf(typeof arguments[i]) == -1){
            content += JSON.stringify(arguments[i])
        }else{
            content += arguments[i];
        }
        
        if(module.exports.logToConsole){
            console.log(content);    
        }
        
		if(!fs.existsSync(installDir)){
			fs.mkdirSync(installDir);
		}
		
        fs.appendFileSync(installDir + "/log.txt", content + "\r\n");
	}
}

function now(){
    var d = new Date();
    return d.getFullYear() + "-" + d.getMonth() + "-" + d.getDate() + " " + d.getHours() + ":" + d.getMinutes() + ":" + d.getSeconds();
}

module.exports.logger = logger;

