function GBK2UTF8(buff){
    var pos = 0;
    var result = [];
    while(pos < buff.length){
        var val = buff.readUInt8(pos) & 0xff;
        pos++;
        
        if(val < 0x80){
            //ASCII
            result.push(val);
        }else{
            //中文

            
            val = val << 8 | buff.readInt8(pos)  & 0xff;
            pos++;
            
            var charTemp = toHex(val, 4);
            result.push(GBKMAP[charTemp].charCodeAt(0));
        }
    }    
    return String.fromCharCode.apply(this, result);
}

function toHex(num, len){
    var hexStr =  (num - 0).toString(16);
    return '0'.repeat(len - hexStr.length) + hexStr.toUpperCase();
}
